import React from 'react';
import Form from './components/Form';
import Todo from './components/Todo';
// import logo from './logo.svg';
import './App.css';

interface State {
  todos: string;
}

class App extends React.Component<{},State> {

  constructor(props:State) {
    super(props);

    this.state = {
      todos: []
    };
  }

  render() {
    return (
      <div>
        <Form />
        <ul>
          <li>
            <Todo text="hogehoge" />
          </li>
        </ul>
      </div>
    );
  }

}

export default App;
